  false,\n\t\"url\": null,\n\t\"notes\": \"Gene rescue captive broodstock program
  was established for ESA-listed endangered Snake River sockeye salmon from Redfish
  Lake, Idaho.  The program has consisted of taking most of the remaining gene pool
  into captive culture at specialized conservation hatcheries at the Manchester Research
  Station and the Idaho Department of Fish and Game Eagle Hatchery.  Fish are being
  released to native habitats as part of recovery efforts.nnInformation on the number
  of eyed eggs, juveniles, and adults received into the program is maintained and
  summarized by year.  The production of adults spawned, adults transferred to Idaho
  for release, green eggs taken, and eyed eggs shipped to Idaho and Oregon facilities
  for restoration activities is also annually summarized.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
